SELECT ?breed ?breedLabel ?origin ?originLabel ( AVG( ?height ) AS ?avgHeight ) ( AVG( ?mass ) AS ?avgMass ) ( AVG( ?lifeExpectancy ) AS ?avgLifeExpectancy ) WHERE {
