  OPTIONAL {
    ?breed wdt:P2048 ?height .
  }
  OPTIONAL {
    ?breed wdt:P2067 ?mass .
  }
  OPTIONAL {
    ?breed wdt:P2250 ?lifeExpectancy .
  }
  OPTIONAL {
    ?breed rdfs:label ?breedLabel .
    FILTER ( LANG( ?breedLabel ) = "en" )
  }
  OPTIONAL {
    ?origin rdfs:label ?originLabel .
    FILTER ( LANG( ?originLabel ) = "en" )
  }
}
GROUP BY ?breed ?breedLabel ?origin ?originLabel

