    wd:Q193637 wdt:P166 ?award .
    ?award rdfs:label ?awardLabel .
    FILTER ( LANG( ?awardLabel ) = "en" )
  }
  ?occupation rdfs:label ?occupationLabel .
  FILTER ( LANG( ?occupationLabel ) = "en" )
}
GROUP BY ?occupationLabel

